import React from 'react';

import { Container } from './styles';

function Card({data}) {
  return (
      <>
        <Container>
         <p>{data}</p>
         <p>{data}</p>
         <p>{data}</p>
         <p>{data}</p>
         <p>{data}</p>
         <p>{data}</p>
         <p>{data}</p>
        </Container>
      </>
  )
}

export default Card;
